import React from "react";
import "../index.css";

function Card(props) {
  console.log(props.title);
  return (
    <li className="elements__item" key={props._id}>
      <button className="elements__delete" type="button" />
      <img className="elements__image" src={props.link} alt={props.title} />
      <div className="elements__bottom">
        <h2 className="elements__title">{props.title}</h2>
        <div className="elements__like-wrapper">
          <button className="elements__like-icon" type="button" />
          <p className="elements__like-counter">0</p>
        </div>
      </div>
    </li>
  );
}

export default Card;
